import React, { useState } from 'react';
import { View, StyleSheet } from 'react-native';
import Card from '../molecules/Card';
import Button from '../atoms/Button';

const profiles = [
  { id: 1, name: 'John Doe', image: 'https://via.placeholder.com/200' },
  { id: 2, name: 'Jane Smith', image: 'https://via.placeholder.com/200' },
  // Add more profiles here
];

const CardStack = () => {
  const [currentIndex, setCurrentIndex] = useState(0);

  const handleLike = () => {
    setCurrentIndex(currentIndex + 1);
    // Add logic for handling like
  };

  const handleUnlike = () => {
    setCurrentIndex(currentIndex + 1);
    // Add logic for handling unlike
  };

  return (
    <View style={styles.container}>
      {profiles.slice(currentIndex, currentIndex + 1).map((profile) => (
        <Card key={profile.id} profile={profile} />
      ))}
      <View style={styles.buttonsContainer}>
        <Button title="Like" onPress={handleLike} />
        <Button title="Unlike" onPress={handleUnlike} />
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  buttonsContainer: {
    flexDirection: 'row',
    marginTop: 20,
  },
});

export default CardStack;
